import React from 'react';
import DetailsComponent from '../DetailsComponent/DetailsComponent';
import './FormCard.css';

const FormCard = (props) => {
    return (
        <div className='form-card'>

            <div className='form'>
                <h4>{props.title}</h4>
                <p>{props.subtitle}</p>
                <label>{props.label}</label>
            {props.type ?     
                <input {...props.input} />
                :
                <textarea {...props.textarea} />
            }
            </div>
        </div>
    )
}

export default FormCard
